import React from "react";
import styles from "./Icon.module.css";

import Image from "next/image";

export const Icon = ({ img }) => {
  return (
    <Image
      src="/menu-icon.svg"
      alt="PPPP"
      width={20}
      height={20}
      className={styles.objetiveFitCover}
    />
  );
};
